import React from "react";
import data from "./mock-data.json";
import {useState} from 'react';
import {Fragment} from 'react';
import { nanoid } from 'nanoid';
import ReadOnlyRow from "../components/ReadOnlyRow";
import EditableRow from "../components/EditableRow";

// sample data:
// using the mock-data.json file to test the functionalities.

function Assets() {
    const [assets, setAssets] = useState(data);
    const [addFormData, setAddFormData] = useState({
        inventoryNum: '',
        cost: '',
        name: '',
        model: ''
    });
// Edit button: repopulate row implmentation 
    const [editFormData, setEditFormData] = useState({
        inventoryNum: '',
        cost: '',
        name: '',
        model: ''
    });
// These consts are used to handle the "Edit" feature.
    const handleEditFormChange = (event) => {
        event.preventDefault();

        const fieldName = event.target.getAttribute('name');
        const fieldValue = event.target.value;

        const newFormData = { ...editFormData };
        newFormData[fieldName] = fieldValue;

        setEditFormData(newFormData);
    };

    const handEditFormSubmit = (event) => {
        event.preventDefault();

        const editedAsset = {
            id: editAssetId,
            inventoryNum: editFormData.inventoryNum,
            cost: editFormData.cost,
            name: editFormData.name,
            model: editFormData.model
        } 

        const newAssets = [...assets];
        const index = assets.findIndex((asset)=> asset.id === editAssetId);

        newAssets[index] = editedAsset;
        setAssets(newAssets);
        setEditAssetId(null);
    }
// These consts are used to handle "Add Asset" 
    const [editAssetId, setEditAssetId] = useState(null); 

    const handleAddFormChange = (event) => {
        event.preventDefault();

        const fieldName = event.target.getAttribute('name');
        const fieldValue = event.target.value;

        const newFormData = { ...addFormData};
        newFormData[fieldName] = fieldValue;

        setAddFormData(newFormData);
    };
//
    const handleAddFormSubmit = (event) => {
        event.preventDefault();

        const newAsset = {
            id: nanoid(),
            inventoryNum: addFormData.inventoryNum,
            cost: addFormData.cost,
            name: addFormData.name,
            model: addFormData.model
        }

        const newAssets = [...assets, newAsset];
        setAssets(newAssets);  
    };

// Edit button to select row.
    const handleEditClick = (event, asset) => {
        event.preventDefault();
        setEditAssetId(asset.id);

        // Edit implementation
        const formValues = {
            inventoryNum: asset.inventoryNum,
            cost: asset.cost,
            name: asset.name,
            model: asset.model
        }

        setEditFormData(formValues);
    };

// This is where the HTML code is generated.
    return (
        <div class="container-fluid">
            <div class="mt-2 bg-light round">
                <div class="px-3 mt-3 mb-3">
                    <h1 class="display-4">Assets</h1>
                    <form onSubmit={handEditFormSubmit}>
                        <table>
                            <tr>
                                <th>Inventory #</th>
                                <th>Cost</th>
                                <th>Name</th>
                                <th>Model</th>
                                <th>Actions</th>
                            </tr>
                            {/* If statement to select which asset.id to Edit */}
                                {assets.map((asset) => (
                                    <Fragment>
                                        {editAssetId === asset.id ? (
                                            <EditableRow editFormData={editFormData} 
                                            handleEditFormChange={handleEditFormChange}/> 
                                        ) : (
                                            <ReadOnlyRow asset={asset} 
                                            handleEditClick={handleEditClick}/> 
                                        )}
                                    </Fragment>
                                ))}
                        </table>
                    </form>
                </div>
            </div>
            <div>
                <h4>Add an Asset</h4>
                <form onSubmit={handleAddFormSubmit}>
                    <input 
                        type="number" 
                        name="inventoryNum" 
                        required="required" 
                        placeholder="Inventory#"
                        onChange={handleAddFormChange}
                    />
                    <input 
                        type="number" 
                        name="cost" 
                        required="required" 
                        placeholder="Cost"
                        onChange={handleAddFormChange}
                    />
                    <input 
                        type="text" 
                        name="name" 
                        required="required" 
                        placeholder="Name"
                        onChange={handleAddFormChange}
                    />
                    <input 
                        type="text" 
                        name="model" 
                        required="required" 
                        placeholder="Model"
                        onChange={handleAddFormChange}
                    />
                    <button type="submit" class="my-2 btn btn-primary">Add Asset</button>
                </form>
            </div>
        </div>
    );
}

export default Assets;
